import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <div>
        <BrowserRouter>
          <Header logedinUser={logedinUser} setlogedinUser={setlogedinUser} />
          <div>
            <Routes>
              <Route path="/" element={<LoginPage />} />

              <Route path="/register" element={<RegisterPage />} />
              <Route path="/profile" element={<ProfilePage />} />

              <Route
                path="/create"
                element={<CreatePost posts={posts} setPosts={setPosts} />}
              />
              <Route path="/allpost" element={<AllpostPage />} />
              <Route path="/singlepost/:id" element={<SinglePostPage />} />
            </Routes>
          </div>
        </BrowserRouter>
      </div>
    </div>
  );
}

export default App;
